query:
mutation policyInternetFirewallMoveSection ( $policyMoveSectionInput:PolicyMoveSectionInput! $internetFirewallPolicyMutationInput:InternetFirewallPolicyMutationInput ) {
	policy ( ) {
		internetFirewall ( input:$internetFirewallPolicyMutationInput  )  {
			moveSectionInternetFirewallPolicyMutations: moveSection ( input:$policyMoveSectionInput   ) {
				sectionPolicySectionMutationPayload: section {
					auditPolicySectionPayload: audit {
						updatedTime
						updatedBy
					}
					sectionPolicySectionPayload: section {
						id
						name
					}
					propertiesPolicySectionPayload: properties
				}

				statusPolicySectionMutationPayload: status
				errorsPolicySectionMutationPayload: errors {
					errorMessage
					errorCode
				}

			}
		}

	}	
}
